import React from 'react';

function Home() {
    return (
        <div className="container"> 
            <div id="cont">
                <h1 className="h-primary">Welcome to the Application!</h1>
            </div>
            <footer>
                Copyright &copy; www.king's Restaurant.com
            </footer>
        </div>

    );
}

export default Home;
